[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mediadive", "sparql_query": "
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX mdv: <https://mediaDive.dsmz.de/rdf/>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>

SELECT DISTINCT ?ingredient ?label ?cas
WHERE {
  ?ingredient a mdv:Ingredient ;
              rdfs:label ?label ;
              mdv:casRegistryNumber ?cas .
  FILTER(CONTAINS(LCASE(?label), "agar"))
}
"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "mediadive"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mediadive", "sparql_query": "
PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT ?ingredient ?label ?cas
FROM <http://rdfportal.org/dataset/mediadive>
WHERE {
  ?ingredient a schema:Ingredient ;
              rdfs:label ?label .
  OPTIONAL { ?ingredient schema:hasCAS ?cas }
  ?label bif:contains "'agar'"
}
ORDER BY ?label
LIMIT 30
"}}]

