[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "mediadive"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mediadive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT ?medium ?label ?finalPH ?minPH ?maxPH
FROM <http://rdfportal.org/dataset/mediadive>
WHERE {
  ?medium a schema:CultureMedium ;
          rdfs:label ?label .
  ?label bif:contains "'LB' OR 'Luria' OR 'Bertani'"
  OPTIONAL { ?medium schema:hasFinalPH ?finalPH }
  OPTIONAL { ?medium schema:hasMinPH ?minPH }
  OPTIONAL { ?medium schema:hasMaxPH ?maxPH }
}
ORDER BY ?label
LIMIT 20"}}]

[{"name": "mcp__togomcp__search_mesh_entity", "input": {"query": "Thermotoga maritima", "limit": 5}}, {"name": "mcp__togomcp__ncbi_esearch", "input": {"database": "taxonomy", "query": "Thermotoga maritima type strain", "max_results": 5}}, {"name": "mcp__togomcp__ncbi_esearch", "input": {"database": "taxonomy", "query": "Thermotoga maritima", "max_results": 10}}, {"name": "mcp__togomcp__ncbi_esummary", "input": {"database": "taxonomy", "ids": ["2336"]}}, {"name": "mcp__togomcp__get_sparql_example", "input": {"dbname": "bacdive"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX bd: <http://bacdive.dsmz.de/rdfs/>

SELECT DISTINCT ?strain ?strainNumber ?speciesName
WHERE {
  ?strain a bd:Strain ;
          bd:strainNumber ?strainNumber ;
          bd:species ?species .
  ?species rdfs:label ?speciesName .
  FILTER(CONTAINS(LCASE(?speciesName), "thermotoga maritima"))
  FILTER(CONTAINS(?strainNumber, "DSM"))
}
LIMIT 10"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX bd: <http://bacdive.dsmz.de/rdfs/>

SELECT DISTINCT ?strain ?label
WHERE {
  ?strain a bd:Strain ;
          rdfs:label ?label .
  FILTER(CONTAINS(LCASE(?label), "thermotoga maritima"))
}
LIMIT 20"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "bacdive"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT ?strain ?strainLabel ?isTypeStrain ?ccn ?ccnLabel ?sc
FROM <http://rdfportal.org/dataset/bacdive>
WHERE {
  ?strain a schema:Strain ;
          rdfs:label ?strainLabel ;
          schema:isTypeStrain ?isTypeStrain .
  ?strainLabel bif:contains "'thermotoga' AND 'maritima'" option (score ?sc) .

  OPTIONAL {
    ?ccn a schema:CultureCollectionNumber ;
         schema:describesStrain ?strain ;
         rdfs:label ?ccnLabel .
    FILTER(CONTAINS(?ccnLabel, "DSM"))
  }
}
ORDER BY DESC(?sc)
LIMIT 20"}}]
